INSERT INTO `hotelad` VALUES ('32', '游记', '用一场旅行铭记与告别', 'upload/1499238890908.png', '&lt;p&gt;我想我们是热爱自然的。我们都想把生命释放于大地长天、远山沧海。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238570487076640.png&quot; title=&quot;1499238570487076640.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;淡绿色的春天的草原，明黄色的夏天的烈日，深蓝色的秋天的湖泊，和洁白的冬天的大雪，生命轮回的四季，构成了我们美好而浓烈的生命。青海和甘肃，应该就是上帝在这颗孤独的星球上小小的试验场。层层叠叠，连绵不断，她用空间的维度描述时间的维度，仿佛是这个世间四季的纽带。感谢我的小伙伴Lu神、S神、Ran哥、Bin哥、Qin妹子，陪我沿着青藏高原与河西走廊之间经历四季的游走，完成这段毕业旅行。&lt;br/&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238570558023493.png&quot; title=&quot;1499238570558023493.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;感谢Lu神，你的知识储备和青海甘肃环线的地貌一样的丰富。一路讲解历史地理生物学知识，从塔尔寺藏传佛教与汉传佛教的渊源，到莫高窟壁画鉴赏，再到雅丹地貌七彩丹霞的神奇，甚至你旅途中冷不丁的一句”亚寒带针叶林“、”木质部“、”韧皮部“，都让我们惊叹连连。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238624211078398.png&quot; title=&quot;1499238624211078398.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;感谢S神，在茫茫戈壁中从风力发电、核电站的物理原理到中国电力产业结构，甚至原子弹、氢弹的故事都向我们娓娓道来。嗯，作为核物理大神是一种怎样的体验。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238624278037717.jpeg&quot; title=&quot;1499238624278037717.jpeg&quot;/&gt;&lt;/p&gt;&lt;p&gt;感谢摄影师Ran哥带着我们一路摆拍、一路高歌，从公路上轻轻哼唱的小情歌到沙漠露营时在舞台上合唱的燕园情。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238570579031705.png&quot; title=&quot;1499238570579031705.png&quot;/&gt;&lt;br/&gt;感谢Bin哥带领我们探讨资产配置、宏观策略和行业研究。还记得在茶卡盐湖时，所有游客都往旅游区走，唯独我们职业病发，一行人往工业区走，还站在烈日下讨论了锂矿上下游产业链的问题。甚至从工业区走到旅游区的路上，我们一度被保安怀疑是逃票的，也是人生新体验。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;感谢盛世美颜Qin妹子，阳光而自信，一路上笑料不断~279+214=？？500减去...的段子笑了一路。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;感谢靠谱的司机马师傅，从宗教信仰到天文地理历史，一一道来，让我们深刻体会到了高手在民间。&lt;br/&gt;&amp;nbsp;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170705/1499238570652062454.png&quot; title=&quot;1499238570652062454.png&quot;/&gt;&lt;br/&gt;在遗忘中不舍醉醒交错&lt;/p&gt;&lt;p&gt;&lt;br/&gt;青春大概如你所说&lt;br/&gt;&lt;br/&gt;在花落时结果期望很多&lt;br/&gt;&lt;br/&gt;青春大概都这样过&lt;br/&gt;&lt;br/&gt;也许还有遗憾甚至很多&lt;br/&gt;&lt;br/&gt;但我相信共你没有白活&lt;br/&gt;&lt;br/&gt;——《青春大概》&lt;br/&gt;&lt;/p&gt;', '2017-07-14', '0', null, null, null, null);
INSERT INTO `hotelad` VALUES ('34', '攻略', '当十二星座去马尔代夫该如何选岛？（一）', 'upload/1499238968655.png', '&lt;p&gt;当十二星座去马尔代夫该如何选岛？&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170713/1499926784195061371.jpg&quot; title=&quot;1499926784195061371.jpg&quot; alt=&quot;1499926933.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;当十二星座想去马尔代夫，拥抱诗和远方还有心爱的TA的时候，无论是哪个星座在选岛问题上一定是一部满满的内心戏，各种小人在心里打架。马尔代夫虽然美，但是一岛一不同，选到不合心意的岛屿可是槽点满满呢。喏，我给你开了一个处方，保证你药到“病”除！&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;白羊座：热情活力四射的永动机——阿雅达、尼亚玛&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170713/1499926862008025934.jpg&quot; title=&quot;1499926862008025934.jpg&quot; alt=&quot;1499927018(1).jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;白羊热情激情，如永动机一般活力四射，像酒吧、宽敞的房间、优质的音响效果，最适合你们一秒钟high爆全场，找到气氛永远不停歇的性格。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;你们在别人面前开朗快乐，像小太阳一样照耀别人，但是内心缺乏安全感，私密性好的房间条件可以给你们带来安稳的入睡环境。&lt;/p&gt;&lt;p&gt;阿雅达——Ayada Maldives&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;阿雅达房间设计以橙白色调为主，一进去就能感受到洋溢的热情，而且房间设施一流，音响效果非常好，360°立体环绕声音音效一级棒，房间宽敞、每个房间都有私人无边泳池，很适合羊羊一到晚上分分钟会睡你XX起来high的节奏。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170713/1499926935102054740.jpg&quot; title=&quot;1499926935102054740.jpg&quot; alt=&quot;1499927079(1).jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2017-07-13', '0', null, null, null, null);
INSERT INTO `hotelad` VALUES ('36', '发现', '南方人第一次去东北，需要注意什么？', 'upload/1499239010352.png', '&lt;p&gt;要注意不要经常发雪景去朋友圈，&lt;/p&gt;&lt;p&gt;会被东北的朋友屏蔽的。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/jdydxt/ueditor1_4_3/jsp/upload/image/20170714/1500025098320061981.jpg&quot; title=&quot;1500025098320061981.jpg&quot; alt=&quot;1500025229.jpg&quot;/&gt;&lt;/p&gt;', '2017-07-14', '0', null, null, null, null);
