INSERT INTO `hotelroom` VALUES ('07', 'b62cf9a0-e340-4549-a430-6a7a0d88', '&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:6px;margin-left: 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;建筑面积：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;32-38&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;平方米&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 6px 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;楼层：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;13-18、21-24&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;层&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 6px 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;床型：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;张双人床&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;米或&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;张单人床&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;1.4&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;米&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 6px 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;可加床：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;RMB200/&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;床&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;/&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;间夜&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 6px 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;该房型可无烟处理&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '入住时间：14:00以后      \r\n离店时间：12:00以前\r\n儿童政策：不接受18岁以下客人单独入住。\r\n3岁以下儿童使用现有床铺免费，不含儿童早餐。\r\n3岁以下儿童加婴儿床免费，不含儿童早餐。\r\n3-18岁儿童使用现有床铺免费，不含儿童早餐。\r\n3-18岁儿童加床收费，每晚RMB200.00，不含儿童早餐。\r\n膳食安排：自助早餐 RMB 98\r\n宠物：不可携带宠物', '1、此房型仅限业主预订使用\r\n2、须提前五天预订，确认后不可取消/修改\r\n3、使用度假币消费，不提供开具发票服务\r\n\r\n', '', '14ae603f-6579-4a0a-af4a-23a80fc8', '1', '', '', '', '豪华房（大/双）', '', '', 'upload/20170724092213.jpg ', '1000', '', '6,8,', '14,15,17,18,20,23,', '26,', '2', '0');
