;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:19px;font-family:宋体&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '入住时间：14:00以后      \r\n离店时间：12:00以前\r\n儿童政策：不接受18岁以下客人单独入住。\r\n0-1米儿童使用现有床铺免费，不含儿童早餐。\r\n1-1.4米儿童使用现有床铺免费，不含儿童早餐。\r\n1.4-1.8米儿童使用现有床铺免费，不含儿童早餐。\r\n0-1米婴儿早餐免费 1-1.4米儿童早餐按照39元/位收费 1.4米以上儿童早餐按照78元/位收费\r\n膳食安排：自助早餐 RMB 78\r\n宠物：不可携带宠物。', '1、此房型仅限业主预订使用\r\n2、须提前五天预订，确认后不可取消/修改\r\n3、使用度假币消费，不提供开具发票服务', '', '14ae603f-6579-4a0a-af4a-23a80fc8', '1', '', '', '', '豪华房', '', '', 'upload/20170720044847.jpg ', '1000', '', '4,6,7,8,9,', '14,15,16,17,18,23,25,', '51,', '2', '0');
