INSERT INTO `hotelroom` VALUES ('039', 'c5ae77c4-d6d7-4cd2-ad9c-dc2ee325', '&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:6px;margin-left: 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;建筑面积：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;28-33&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;平方米&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:6px;margin-left: 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;楼层：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;2-5&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;层&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:6px;margin-left: 0&quot;&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;床型：&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;张双人床&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;1.8&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;米或&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;张单人床&lt;/span&gt;&lt;span style=&quot;font-size: 18px;font-family: Arial, sans-serif&quot;&gt;1.2&lt;/span&gt;&lt;span style=&quot;font-size: 18px&quot;&gt;米&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:6px;margin-left: 0&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;该房型可安排无烟楼层、无烟处理、有无烟房&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '入住时间：14:00以后      \r\n离店时间：12:00以前 \r\n儿童政策：不接受18岁以下客人单独入住。\r\n0-1岁儿童加婴儿床收费，每晚RMB50.00，不含儿童早餐。\r\n每间房最多一位0-11.99岁儿童不另加床可与两位成人入住同一间。加床视房型允许，至多一张且限0-11.99岁儿童使用，加床（婴儿床RMB50净价/张/天，儿童加床RMB269净价/张/天）与早餐（平日价RMB129/份，法定假日为当日门市价，具体以酒店最后确认价格为准）费用不会自动计算在已预订的房价总价中，须另付酒店前台。 请注意，加床费不包含早餐。含早餐的房价请见注明的提供早餐份数。 包含早餐的房间，每房至多一名身高120cm儿童可以享用早餐。身高140cm以下儿童可以享用半价早餐，身高140cm及以上的儿童需支付早餐的全额费用。\r\n加床政策、儿童人数请参见您所选定的客房政策，若超过房型限定人数，可能需收取额外费用。提出的任何要求均需获得酒店的确认，所有服务详情以酒店告知为准。 \r\n膳食安排：自助早餐 RMB 129 \r\n宠物：不可携带宠物。 \r\n', '1、此房型仅限业主预订使用\r\n2、须提前五天预订，确认后不可取消/修改\r\n3、使用度假币消费，不提供开具发票服务', '', '14ae603f-6579-4a0a-af4a-23a80fc8', '1', '', '', '', '海宇楼园景豪华房', '', '', 'upload/20170721084659.jpg ', '1000', '', '4,6,7,8,9,', '14,15,16,17,18,23,', '65,', '2', '0');
