INSERT INTO `news` VALUES ('6', '测试关于我们', '2017-07-05 16:20:47', '1111', '', 'upload/20170705042041.jpg ', '', '');
INSERT INTO `news` VALUES ('8', '宁波爱度假网络科技有限公司', '2017-7-11 17:31:05', '『有个度假屋』是宁波我爱度假网络科技有限公司开发的旅游度假投资平台，结合分时度假及民宿投资热潮，将度假与投资理财完美结合起来，为广大喜爱旅游度假的朋友打造更多更好的旅游度假投资产品。在满足自身度假需求的同时，将小额投资交给专业的运营管理团队，以此获得良好的投资回报。我们严格筛选产品，包括所在目的地是否为极佳的度假目的地，该产品在度假地的地理位置，产品建筑品质，酒店运营商，酒店经营保障，产品风险控制等，以保障每个投资我们产品的客户，既能在自己投资的度假屋内带着朋友家人度过美好的假期，也能使自己投资的产品为自己赚取良好的利润。别人的度假是消费，我们的度假是投资。', 'admin', 'upload/log.png', '1', '');
INSERT INTO `news` VALUES ('15', '欢迎使用『有个度假屋』小程序', '2017-7-14 17:51:36', '欢迎使用『有个度假屋』小程序！', 'admin', '', '0', '');
INSERT INTO `news` VALUES ('16', '关于度假币的转赠问题', '2017-08-22 15:36:44', '度假币的赠送目前只能在业主与非业主之间进行。度假币的赠送在我的度假币中，业主账户点击生成赠送码；非业主账户也是在我的度假币中，输入赠送码点击领取即可。', '', '', '2', '');
INSERT INTO `news` VALUES ('17', '关于业主账号与非业主账号的切换问题', '2017-8-22 15:40:26', '在小程序中，如果想要退出账号登陆，需要在小程序列表中删除有个度假屋，然后重新搜索有个度假屋，再进行登陆即可。但是，同一个微信账号，我们不建议既是业主，又是游客，这样比较容易出错。', 'adjadmin', '', '2', '');
